import React, { Component } from "react";
import NavTop from "./nav_top";
import Breadcumps from "./breadcumps";
import Footer from "./footer";
import Table from "./tables";
import Nav from "./nav";
import User from "./users";

class wrapper extends Component {
  constructor(props) {
    super(props);
    this.state = { users: [] };
  }

  fetchData = () => {
    fetch("api/users")
      .then(res => res.json())
      .then(Users => {
        this.setState({ users: Users });
      });
  };

  componentDidMount() {
    this.fetchData();
  }

  render() {
    const ColumnData = [
      {
        label: "UserName",
        field: "UserName",
        sort: "asc",
        width: 250
      },
      {
        label: "Email",
        field: "Email",
        sort: "asc",
        width: 270
      },
      {
        label: "Telephone",
        field: "Telephone",
        sort: "asc",
        width: 200
      },
      {
        label: "Telephone",
        field: "Telephone",
        sort: "asc",
        width: 200
      }
    ];

    const Rows = json
      .parse(this.state.users)
      .includes("UserName", "Email", "Telephone", "Telephone");
    return (
      <div id='wrapper'>
        <Nav />
        <div id='page-wrapper' className='gray-bg'>
          <NavTop />
          <Breadcumps tablename={"Users"} />
          <User users={this.state.users} Rows={Rows} columns={ColumnData} />
          {/* <Table users={this.state.users} onChange={() => this.fetchData} /> */}
          <Footer />
        </div>
      </div>
    );
  }
}

export default wrapper;
